INSERT INTO `draw` VALUES (1,'第一籤','籤<br>王','佳偶耶？<br>神仙美眷也。<br>夫復何求?<br>','對對佳偶.神仙美眷.百年偕老.無須再覓良緣。','人的禍福.延自祖先的福報，因祖先庇佑，得遇佳偶,是個歡樂而美滿的良緣，而且好\"因緣\"也會延須至下一代，是個上上大吉籤，求得此籤目前福緣俱足，和合常樂，兒孫滿堂，更宜多種福田，問緣份，大吉。問婚姻，可合和圓滿。',1),(2,'第二籤','中<br>','落霞與孤鶩齊飛，<br>秋水共長天一色。<br>','落霞與孤鶩齊飛，秋水共長天一色.落霞與孤鶩。均是寂寞。寥落之象也。於落霞之中。單象影隻之鶩飛行者。予人深感秋盡冬之來。旺盛蕃衍之夏季已過。秋已盡。如此際遇之時。君汝宜樂善不倦積德當先。待時之時。自有合成之時。','再等一段時間 ，自然會有屬於自己的緣分出現，求得此籤目前福緣不足，難免失意，懊悔，宜多種福田，問緣份，難成。問婚姻，難和諧。',1),(3,'第三籤','上上<br>大吉<br>','宗廟享之，<br>子孫保之。<br>','上一代之福延於子孫。禍亦同也。福之延於吾一代。其惠愛之情。當不可須臾忘之。享自上一代。吾當設法延於下一代。事事如此之時。一代延下一代。皆可享用不竭。汝懷念祖先。子孫亦同之。','很多事有因而有果，如同上一代祖先積福而讓下一代子孫享福，因此，子孫享福的同時，也應該繼續行善造福，讓自己的下一代亦有福蔭之庇佑。',1),(4,'第四籤','中<br>','斯人也，<br>而有斯疾也；<br>斯人也，<br>而有斯疾也。<br>','一個人皆有疾。毛病。癖之所成。連聖賢在修養到家之前也是如此。毛病與過失。皆不能免。古訓曰：知過能改，善莫大焉。猶如人若有疾病而不忌醫。將獲痊癒。','目前福緣不佳，猜疑口舌鬥爭難免，宜多種福田，問緣份，不吉。問婚姻，防口舌。',1),(5,'第五籤','上<br>','逾東家牆，<br>而摟其處子，<br>則得妻。<br>不摟，則不得妻。<br>','如在偶然之機會。或相處已久。視伊人為終身可許之者。應採取行動。不宜逸失機會。姻緣之至也。必須勇往邁進。','求得此簽目前福緣平平，須小孩來牽成，宜多種福田，問緣份，成則吉，問婚姻，孕更吉。',1),(6,'第六籤','上<br>吉<br>','風弄竹聲，<br>只道金佩響；<br>月移花影，<br>疑是玉人來。<br>','風弄竹聲，只道金佩響；月移花影，疑是玉人來。春風一動。竹葉之搖晃。沙沙作響。啻可聽道金佩在響。月日一日日地去耶。花影見了。心底下。疑玉人來。繇此可知。君之好事已近。','目前福緣佳，可享魚水歡，更宜種福接福問緣份，成者大吉。問婚姻，合和,須防外遇',1),(7,'第七籤','上<br>','斯是陋室，<br>唯吾德馨。<br>','雖居於簡陋之閨房。唯一己之德俱備時。自有它馨香之處。易言之。一己。居於極陋之室中。如德。智皆備之時。天自有賜良緣之時。不必自卑自棄耶。','目前福緣欠佳，難免落寞失意，宜多種福田增福，問緣份，不急且修心。問婚姻，難諧。',1),(8,'第八籤','中<br>上<br>','期我乎桑中，<br>要我乎上宮，<br>送我乎淇之上也。<br>','男女之婚姻是終身大事。是決定人生一生幸福之大事。爰之。不得以逾越。不正。強行等。手段行之。必須以正當方式取得對方之芳心。兩相情願之下完成。如違反上述原則行之時。雖結合。惟兩者之間。貌合神離。不得行之。否則良緣亦為此破壞無遺。','目前福緣不佳，分分合合，宜多種福田增福，問緣份，勿強求。問婚姻，貌合神離。',1),(9,'第九籤','上<br>','則父母，<br>國人皆賤之。<br>','則父母。亦即使君爾之椿萱也。皆輕視君汝之意。繇此可之。為人子弟者。為合受父母疏遠。唾棄。賤之。原因多矣。最大之原因。不出不慎交友。如一己之不慎。一失足成千古恨之時。終生之伴侶。必須慎擇之。','目前福緣不足，須得神佛及貴人之助方能圓滿，為人子女者，需謹慎交友，聽從父母及長輩或貴人的意見，不可一意孤行。',1),(10,'第十籤','下<br>','有道是養兒防老，<br>積穀防饑。<br>','自古以來有兩大古訓。養兒為了一己之防老。老了以後。可繇伊等侍奉。貽娛老年。平素則省吃儉用。積穀可防饑。尤其是養兒耶。必須善教之。婚事同之。結髮成伉儷之後。老境亦能相互照顧也。','目前福緣俱足，奉\"子\"之助更加圓滿，種福田積後福，問緣份，得貴助。問婚姻，伉儷情深。',1),(11,'第十一籤','中<br>平<br>','<h2 style=\"font-size:17px;\">剪芭蕉寫佛經，<br>蓮無複印中庭。<br>風明月長相憶，<br>管朱弦可要聽，<br>病不勝衣更薄，<br>妝猶在酒初醒。<br>星年違別成何，<br>看牽牛織女星。<br></h2>','猶如多病之人。衣薄，宿粧又如酒初醒。不如現在。皆意養吾身。有了健全之身。自有健全志隨。唯有如此。方有新機會可逢遇。','不要眷戀悔恨過去，都是枉然，應懂得珍惜。要開心振作精神，迎接新的機緣。目前福緣盡，情緒反覆患得患失。宜多自省。問緣份，去舊迎新。',1),(12,'第十二籤','中<br>','一則以喜，<br>一則以懼。<br>','此塵世之事。無以兩全其美者。十之八九不如意。如此反覆不以之世景下。吾人該以如何面對。面對現實。分析並取捨之。不宜奢求。亦不必為小挫而氣餒。','當下雖不能兩全其美，但只要面對現實，就事情分析及研判並取捨，終能突破萬難。此籤目前福緣不足，有得必有失。憂喜參半。問婚姻，先否後泰。',1),(13,'第十三籤','上<br>','山窮水盡疑無路，<br>柳暗花明又一村。<br>','前面一片重重疊疊之山嶺。覺得自己再業沒路可行。忽出現一村子。在心灰意懶。萬念俱灰之時。峰迴路轉。來了一線生機。為君帶來莫大希望。汝已入佳境。必有佳遇耶。','看似沒有希望的戀情，也有復合的可能，若再婚，或許會得到幸福，但要靠媒妁之言來進行婚事的成功，並浪費過多的時間，目前福緣平平。',1),(14,'第十四籤','上<br>上<br>','誰謂荼苦，<br>其甘如薺。<br>宴爾新婚，<br>如史如弟。<br>','一己之先入觀念。對某物有喜愛。讚賞有加。愛屋及烏。如苦瓜。苦茶。雖是有苦味。但喜愛之人食之必言其美味且甘耶。伴侶之選擇復之如是。以愛為出發。自無貴賤之分。愛之有加。','對感情不要有先入為主的成見，愛一個人就要不分貧富貴賤，階級長幼，高下，身份，目前福緣俱足,平安穩健，更宜多種福田延續，問緣份，大吉。問婚姻，合和穩定無須憂心。',1),(15,'第十五籤','中<br>','君子審禮，<br>不呆誣以奸詐。<br>','君子之為人也。必須注重禮節。凡是明知言行之失去禮節者。皆守正。絕不入不正之途，如冰清玉潔。必受人歡迎。且他人亦無有可乘之地。無法藉詞加以誣蔑。','行為舉止不可忘形輕佻及逾越禮節，目前福緣不佳,不可有欺凌詐騙之念，否則必有報應。宜多種福增福。問緣份不佳，宜保持距離。問婚姻，防私情外遇。',1),(16,'第十六籤','上<br>上<br>','意中人，人中意，<br>無情花鳥也情凝，<br>解結枝頭學並棲。<br>','一己之心。盡了人事。必有精賬。易言之。意中人。人中意。真情表露時。連那些不能言語之花鳥亦可致意者。意。情之到也。緣份附之。必有時機之來到。','求得此籤目前福緣豐厚，只要同心皆可逢凶化吉，更宜多作福增福。問緣份，得貴人助，合和圓滿，問婚姻，先否後泰，合和圓滿。',1),(17,'第十七籤','中<br>','德者本也，<br>財者未也。<br>','一人於世。立德立言立功三者。有德者輕財。具有德而重財，德隨之墮。由此可知選婿選妻。亦須據此原則。婿擇良人。妻求之淑女。千萬不可重財輕德。則後果堪虞。','談感情宜暫擱下，待機緣成熟，維持君子風度，若貿然談感情，給對方負面形象，造成品格缺失。目前福緣不足，應多作福增福改變福報，問緣份，謹慎擇偶，問婚姻，以德相扶，共患難。',1),(18,'第十八籤','上<br>','非獨內德茂也，<br>蓋亦以外感之助焉。<br>','具有才能之人。因書讀多。品德。學識俱豐。不願將自己才華露於外。婚姻不同。心中喜歡。將一己之力。適度顯示。以激發對之。引起對方信賴是心要者。秘而不宜。伊人。必有所礙。一走了之。','具有才能之人學識修養俱佳，不願才華露於外，但婚姻不同，不可靦腆，需將愛慕想法，適度表達。此簽目前福緣俱足，平安穩健，問緣份，勇敢表白。問婚姻，誠意溝通。',1),(19,'第十九籤','上<br>','或十年，<br>或七八年、<br>或五六年，<br>或三四年。<br>','或五六年，或三四年皆以年月之。君汝與她之緣之成。或費三四年補六年。或七八年甚十年。當提起後。因時空事業學業。關係分東。有了某種契機。有急驟轉變。速即恐有變。耐心待之。','因人、事、地，等時機不對，目前雖有某種契機，但時機仍不對，耐心等待，目前福緣不足，易受家人或環境之影響，暫無法突破困境。',1),(20,'第二十籤','上<br>','何如，<br>子曰，可也。<br>','如有人問。問題該何如解決。曰：可也。即可以進行之。問之何人。即是就放於我之師長。汝可抱為南針。毅然行之。婚姻同之。目下君所交之伊人。可與否。請教長輩。伊人之眼光中。可者可取之。','凡事立即下定決心進行，無須憂慮。求得此簽目前福緣平平，最好多問神佛長輩再擬行動。問緣份，可者成者大吉。問婚姻，可者，可速進取之。',1),(21,'第二十ㄧ籤','上<br>上<br>','十畝之間兮，<br>桑者閒閒兮。<br>','曾是五畝田之家。家人即可三餐得溫飽。今之。已有十畝之地可植桑麻。更寬裕之。生活穩定。名利薄。淡於名利。生活則樂。否則天譴。','此籤目前福緣天賜已足，雖目前還有不順機緣不足，安份守舊保順遂。不可惑於美色名利。見異思遷貪求無厭。則必招天譴破敗。問緣份，天賜良緣。問婚姻，惜福惜緣。樂天知命，百年好合。',1),(22,'第二十二籤','上上<br>大吉<br>','久旱逢甘雨，<br>他鄉遇故知，<br>洞房花燭夜，<br>金榜掛名時。<br>','大吉大利之象，平常所謂雙喜臨門，已是罕見，如今四喜臨門，真是人間少有。五福臨門世上無雙。','籤詩提醒你，與對方緣分不佳，另有其他姻緣，非此段感情得以復合 ，此籤若是沒有交往者，四喜臨門，愛情順利，喜事連連。',1),(23,'第二十三籤','中<br>','山只一點故情留，<br>直似春蠶到老，<br>尚把絲抽。<br>','伊人作情。汝為其情所迷。如春蠶之蛹。固執之。一個人之情。卻未必如此癡之。凡事者。中庸之道守之。未必死心塌地之境地。不可不知者。宜自重之。','這段感情完全是你一人的單相思，對方不一定對你有有厭惡之感，但卻對你毫無感情。目前福緣不足，最好多求神作福。不可癡心絕對。否則大錯特錯。問緣份，此情可待成追憶。問婚姻，若心已似鐵，強求何益。',1),(24,'第二十四籤','中<br>','他思已窮，<br>恨不窮，<br>是為嬌鸞鶵鳳失雌雄。<br>','他思之己窮。表明伊也對爾已無愛情可言。不僅無愛情可言。且恨汝入骨。原因何在。她尚在孤單一人。是為嬌鸞鶵鳳。失雌雄。易言之。如有子女。恐怕不與伊人在一起度此生。宜求神解之。','目前對你的愛意可全是全無，且恨之入骨，恨你不代表另有新歡，而是另外的原因，若有子女，恐怕不易與之一同相處，目前福緣不佳，切莫等閒視之。',1),(25,'第二十五籤','上<br>','可妻也。<br>','可妻也。伊人是好伴侶。可娶嫁之。惟目前尚有若幹問題之存在。均是瑣碎不必彈慮者。既成好事也。將來必永浴愛河。白頭偕老。','對方是個很好的對象，你們之間尚有許多問題存在，但也無須過慮，不管遇到什麼問題，都不要太過急，平靜的去處理，目前福緣平平，若能再多禮佛修福，熱心公益。累積善因善心，姻緣自有更多的福報，自然會有神佛及貴人幫助你加速成功圓滿順遂。',1),(26,'第二十六籤','上<br>上<br>','維熊維罷，<br>男子之祥。<br>維虺維蛇，<br>女子之祥。<br>','男性夢中見熊。羆等物也。吉祥也。將有飛黃騰達之一日。女性之夢中見虺。蛇之屬。亦是祥兆也。本首之詩文告之於君。生男者可成莫雄。生女者為淑媛也。','其實緣份還蠻玄的，該是您的，絕對跑不掉。如對象是真心守侯您的，就算是大水來沖也沖不掉。目前福緣圓滿，多累積善因善心，自有更多的福報庇蔭子孫，成功圓滿順遂。問緣份，有懷孕之兆。問婚姻，吉祥之兆。',1),(27,'第二十七籤','上<br>平<br>','有宗室之美。<br>','世人皆平等。人生而平等。並無天子。赤子之分也。爰之。君汝為尋佳偶時。必須從平常人尋找去。門當戶對。或古人之訓也。惟世人之視覺自不同於曩息。宜以愛心與緣份為重可也。','人是平等的沒有貴賤之分，必須要從平常人中去找，重要的是有愛心和緣分，不可貪求富貴而自尋煩惱。求得此籤目前福緣平平，不可貪求富貴而自尋煩惱，問。問婚姻，惜福惜緣，百年好合。',1),(28,'第二十八籤','上<br>','夫婦也，<br>昆弟也。<br>','一生結為夫妻。為伉儷。必須如昆弟。亦即是如同手足情深之親兄弟。相敬如賓。決心結為連理之枝。飛於天空之比翼鳥。終生得幸福矣。','夫妻一生一世要永結同心，以此為信念相互扶持，愛護並尊重及容忍彼此所有的一切，必得幸福，目前福緣圓滿，更宜多求神造福延續福報。問緣份，大吉。問婚姻，惜福惜緣，百年好合。',1),(29,'第二十九籤','中<br>平<br>','有意栽花花不發，<br>無心插柳柳成蔭。<br>','悉心照顧花兒。惟為何。明明作對之。中途夭折。話說回來。簡單之插下池邊之柳枝卻蓬勃發芽。婚姻又如此。本是有意甲家之女。卻娶上乙家之女。是非常美妙之事。','目前所問對象與您不會有結果，反倒是其他人會與您有結果，但無法看出此人是否已出現。',1),(30,'第三十籤 ','中<br>','<h2 style=\"font-size:17px;\">話別無長夜，<br>相思又此春。<br>瑤姬不可見，<br>巫峽更何人。<br>運石疑填海，<br>乘槎欲問津。<br>瑤情每未注，<br>誰共爾為鄰？<br></h2>','時為話別之時。恨時間太短。想思於此。皆空思幻想矣。並無濟於事。瑤姬。巫峽。皆不可見之地。於渺茫之地。唯事必須重實際。實事求是。才有收穫之時。見茫霧之境。皆無益者。','凡目前與此對像緣份不足，這只是一段鏡花水月的緣份，處在相思的痛苦中，一切卻如雲雨巫山一樣的渺茫，只能在短暫的私會或在夢中求得一些感覺和安慰。',1),(31,'第三十一籤','中<br>平<br>','設虛，夜靜水寒，<br>魚不餌。<br>笑滿船空載明月。<br>','萬籟俱靜。水深又冷之時。魚兒不得餌。出獵去之時。又逢空手回之。船隻載明月上歸途也。可知君目下之運也。宜重實際。不宜作虛幻之事。實事求是。否則事事落空。無一所成耶。','專心在生活上對他就好了 ，否則事事落空無一所成，目前緣份不足，時機不對，妄想自生災，宜多求神作公益廣結善緣。',1),(32,'第三十二籤','上<br>','因荷而得藕，<br>有杏不須梅。<br>','此詩文者以同音諧之。因荷「何」而得藕「偶」。有杏「幸」不須梅「媒」者。君汝可知道。因荷之生方得蓮藕。為何我能得偶。我亦不得而知。爾是杏「幸」運之人也。自然不需「梅」。媒來妁之。君之鴻運。無人可與倫比也。','求得此籤乃\"緣訂三世\"，只需機緣成熟，自然相聚圓滿，更宜多求神造福延續福報。',1),(33,'第三十三籤','上<br>上<br>','可以托六尺之孤，<br>可以寄百里之命。<br>','君汝如能逢遇鮑叔牙耶。可全心誠意之對付之。伊人也。是貴人也。伊之黼增華之時。君汝亦必有大成之時。爰之。一人之希望。可托於伊之身上。','你可望遇貴人、知音，交至友，得生死相許之配偶，可以全心誠意交付對象，目前福緣圓滿，你們的姻緣一定會有美好的結局，更宜多求神造福延續福報，問緣份，月老牽成。問婚姻，天作之合。',1),(34,'第三十四籤','中<br>平<br>','仍舊貫，如之何？<br>何必改作？<br>','君爾目下雖處在逆境。唯必須持之。不宜變之。見之狀。為己周章。則愈形愈挫。不宜見異思遷。堅守舊之況。必有機緣之來。不可慌耶。','雖然目前是處在逆境、感情不順時期，但你必須保持現狀，先冷靜觀察理解目前的感情困境，不畏挫敗努力去突破，不可見異思遷。',1),(35,'第三十五籤','下<br>','遇人之不淑矣。<br>','今之所逢遇耶。伊人是害人之人也。明知不可交。宜速止之。另擇佳偶去可也。','現在你所知到的人，如果知道品德不太好，就不能深交，應該離開，當然如果不知道，說明現在還沒遇到不淑之人也。',1),(36,'第三十六籤','上<br>','投我以木桃，<br>報之以瓊瑤。<br>','我之友予我木桃。如野人之獻芹者。吾感激之。必報以瓊瑤之玉也。世人曰吃人斤量也。必報以兩。今之食兩。還斤。易言之。一己之待人以誠。將得善果者無疑。必守之人之守則也。','待人誠心，付出多，必有好結果，倘若有對象必能持守，沒有對象誠摯待人也必有好姻緣。',1),(37,'第三十七籤','中<br>','求則得之，<br>捨則失之。<br>','若得機會之時。必須把握。一有機會。君偶目下逢之際遇也。是紅之運。求之則得之。捨其機會則棄之。無法再追者。既有機會。千萬不可捨之。','你目前所得到的機會，必須真正的把握，目前你的氣運正當紅，此次機會難得，千萬不要猶豫，如果失去此機會，還能不能再遇上，也就是說氣運了。',1),(38,'第三十八籤','上<br>吉<br>','妻焉者，<br>親之主也。<br>','妻者。除椿萱。兄弟之外最親密者。爰之對妻之態度。必須如對己之親人父母。重視之。平等對待之。','對象有沒有希望從籤詩上來看，是建議你對對方應該如同對待親人一般，適時關懷，給與支持與鼓勵，也許會有不錯的回應。',1),(39,'第三十九籤','上<br>','不得乎親，<br>不可以為人。<br>不順乎親，<br>不可以為子。<br>','一人如失去父母之心。何以為人乎。失去親人之心。同時將失去朋友。友朋已失。一切皆去耶。宜知孝敬父母。悌其兄弟及友。方能得於世人之心。','要你等待時機，不要心急，不要衝動，否則連普通朋友都做不成，要你順其自然，此話暗示有兩種：一是要你順其自然，二是表示很難成為夫妻。',1),(40,'第四十籤','中<br>','踏破鐵鞋無覓處，<br>得來全不費功夫。<br>','為了成一事。穿上鐵鞋奮鬥不懈。費心費力。皆無所獲。了然耶兩手到頭來皆空空。','之前過程一路走來辛苦，但是如果願意放手，看的開一點，或許會有貴人出現或者突然就有意想不到的結果也是得來不費功夫。',1),(41,'第四十一籤','上<br>平<br>','良人者，<br>所仰望而終身也，<br>今若此。<br>','一人之善惡。必須終身能堅守為要件。本心為假冒。狐皮覆之。狐假虎威。終能露出馬腳之時。如得知其人之底心露者。立即取消之。漸其疏遠之。甚至斷之。否則有悔不當初之時也。','問感情或交友狀況，那麼可得小心了，倘若你現在的朋友是虛有其表，你要懸崖勒馬，逐漸地斷絕交往的意思，因為他不是你未來的正緣，而且會讓你後悔不已。',1),(42,'第四十二籤','中<br>','重重疊疊上瑤台，<br>幾度呼童掃不開，<br>剛被太陽收拾去，<br>卻教明月送將來。<br>','汝今雖有意外之損失。但亦將有意外之收獲。時間不至於久耶。','這支籤詩是注定你跟對方是，已注定，雖然中間幾度小波哲卻依然是你的。',1),(43,'第四十三籤','上<br>吉<br>','君子有援勤之桃，<br>淑女無投梭之拒。<br>','身為君子之伊也。有援琴之桃時。淑取自無投梭而拒君於千里之外者。易言之。如男之汝。有意接納時。淑女之爾。自無拒於千里之外之理由耶。','即使兩方相隔千里之外，只要你有恆心持續感情，對方不會拒絕你。',1),(44,'第四十四籤','上<br>','遐邇一體，<br>率賓舊王。<br>','遐也遠。邇亦瑤之遠也。自古以來有千古不易之理。不論古今之時。東西之地。新人不如舊雨。新土亦不如舊主者也。伊人之關乎微至。','如果是男女剛分手，趕快冰釋前嫌，如果是單身已久，新戀情可能是你身邊的朋友，或你在乎的人，此簽，意味著，可別太粗心而錯過美好姻緣。',1),(45,'第四十五籤','上<br>','後生可畏，<br>焉知來者之不如今也。<br>','君爾目下之人。本是可心滿意足之人。焉知後來之人。一個比一個更美好。就此環境下。只好願君作選擇矣。慎選之。品、學，兼豐而體能慎之。','姻緣在後不可操之過急，過程中許多姻緣讓你動心，但是隨後而來的一切，卻又讓你難做選擇，需要等待，好酒沉甕底。',1),(46,'第四十六籤','中<br>上<br>','不愧於天，<br>不怍於人。<br>','一人之言行方正之時也。對天而不愧。對地而不昧。視人生之財也。如浮雲之所以。心之守正。半夜有人敲門。心自不驚。為人之守則。必須守之。','不管自己再做什麼事，都能光明正的大對得起對方，無論私底下的行事作風，自己也都了然於心，而無欺滿，必須坦承已對，方能長久。',1),(47,'第四十七籤','中<br>','害女紅者也。<br>','所謂女紅者，為人繡羅衣之人也。此埋頭苦幹。為人刺繡者。厭其羅衣者居多。因女紅辛苦繡之。並不能享用其物而慨歎之。為人作燈泡。牽線是已。','過份追求，會加重他人負擔，要適可而止。',1),(48,'第四十八籤 ','上<br>吉<br>','五百英雄都在此，<br>不知誰是狀元郎？<br>','今日在君眼前者。皆為一時之選。人才濟濟。各有千秋。人人之狀元之郎君也。必須慎選。選如意郎君之原則也。品德為首。學識次之。門之當。戶又對乎。千萬叵重人之財。門閥。否則悔之已晚之時。','觀察品性與操守，別以物質與外貌為優先考量。',1),(49,'第四十九籤','上<br>平<br>','故好而知其惡，<br>惡而知其美者。<br>','友朋交上以後。由衷喜歡伊人。唯時間一久。不知不覺發現其缺者。相反之。交上心坎裡不太喜歡之人。唯久而久之。反而發現其美之所在。是何者該密交捨之宜疏遠之人。宜自行審慎斷之。取捨小心可也。','兩人因時間的相處，合者走的下去、不合者則開始思考分開，要合要分自己要想清楚。',1),(50,'第五十籤','中<br>','兩世一身，<br>形單影支。<br>','兩世之一身也。指君汝之單身漢渡世之主義。光棍。將形成形單影隻。何苦後。男大當婚。女大當嫁。是千古不易之理也。為調節生活之枯燥。宜棄之所謂王老五主義。宜談婚嫁也。','意思就是在說你不想結婚的主意，之後就會一直找不到另外一半，孤單一人，何苦要讓自己以後變成這樣，代表現在適合談婚嫁的意思。',1);
