-- Dumping data for table `temple_msg`
--

LOCK TABLES `temple_msg` WRITE;
/*!40000 ALTER TABLE `temple_msg` DISABLE KEYS */;
/*!40000 ALTER TABLE `temple_msg` ENABLE KEYS */;
UNLOCK TABLES;

--
-- Table structure for table `temple_msg_in_msg`
--

DROP TABLE IF EXISTS `temple_msg_in_msg`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `temple_msg_in_msg` (
  `ID` varchar(255) NOT NULL DEFAULT '0' COMMENT '回應編號',
  `iMSG_ID` varchar(255) NOT NULL COMMENT '留言板編號',
